import React from 'react';
import { IonHeader, IonToolbar, IonTitle, IonContent } from '@ionic/react';

import './index.css';

class scanDevices extends React.Component {
  render() {
    return (
      <IonContent>
        <IonHeader class="main-header" onLoad={test()}>
          <IonToolbar class="main-toolbar">
            <IonTitle class="main-toolbar-title" size="large">Looking for devices...</IonTitle>
          </IonToolbar>
        </IonHeader>
      </IonContent>
    );
  };
};

function test() {
  return console.log("loaded!");
}

export default scanDevices;
